import React, { Component } from 'react';
import { Grid, Image, Container } from 'semantic-ui-react'
import { Input } from 'semantic-ui-react'
import { Button, Icon,Divider } from 'semantic-ui-react'
import token from './abi'
import '../CSS/manufacturer.css'



class Manufacturer extends Component {
    constructor(props) {
        super(props);
        this.state={
            company_name:''
        }
    }


    componentDidMount()
    {
        console.log('New page');
        console.log(this.props.company);
        // //console.log();
        var url = "http://localhost:4000/company/" + this.props.company;
        // fetch(url)
        //     .then(res => res.json())
        //     .then(company_name => this.setState({company_name}))


            fetch(url, {
                method: 'GET'
            }).then(function(response) {
                if (response.status >= 400) {
                    throw new Error("Bad response from server");
                }
                return response.json();
            }).then(data => {
                console.log(data[0].name)
                this.setState({company_name: data[0].name});
            }).catch(err => {
            console.log('caught it!',err);
            })
    }

    handleSubmit = async e => {
        e.preventDefault();
        console.log('Entered');


        token.methods.new_model('0x'.concat('', Buffer.from(document.getElementById('sn').value).toString('hex')),
            '0x'.concat('', Buffer.from(document.getElementById('cpu_id').value).toString('hex')),
            '0x'.concat('', Buffer.from(document.getElementById('motherboard').value).toString('hex')),
            '0x'.concat('', Buffer.from(document.getElementById('memory_id').value).toString('hex')),
            '0x'.concat('', Buffer.from(document.getElementById('hdd_id').value).toString('hex')),
            '0x'.concat('', Buffer.from(document.getElementById('ssd_id').value).toString('hex')),
            '0x'.concat('', Buffer.from(document.getElementById('graphics_id').value).toString('hex')),
            '0x'.concat('', Buffer.from(document.getElementById('battery_id').value).toString('hex')),
            '0x'.concat('', Buffer.from(document.getElementById('serviceid').value).toString('hex'))).send({ from: this.props.company })
            .on('transactionHash', function (hash) { console.log(hash) })

    }
    render() {
        return (
            <div className="full">
                <div className='topbar'>
                    Verify.

                </div>
                <div className="Logout">
                    <Button className="btn1">LogOut</Button>
                </div>
                <div className="admin">
                    <Button className="btn1">{this.state.company_name}</Button>
                </div>
                <div className="divider">
                    <Divider />
                </div>
                    <div>
                    <Container textAlign="center">
                    <Grid centered>
                        <Grid.Row>
                            <Grid.Column width={1}>
                                <Image src='data:image/png;base64,' size='medium' circular />
                            </Grid.Column>
                            <Grid.Column width={13}>
                                <p>SERIAL NUMBER</p>
                                <Input ref='sn' id="sn" icon='barcode' placeholder='SERIAL NUMBER' className="icon" focus />
                            </Grid.Column>
                        </Grid.Row>

                        <Grid.Row>
                            <Grid.Column width={1}>
                                <Image src='data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/2wCEAAkGBxMTEh
                                UTExMWFhUWGB0aGRgYGBofIBsXHiAdIB4aGR4hIiggGh4mHh4YITEiJikrLi4uIB8zODYtNygtLisBC
                                goKDg0OGxAQGy0lICYzLS8tMDAtLS0tLy0vLSstLS0wMi8tLS8vLS0tLS0tLS0tLS0tLS0tNS0tLS0tLS0t
                                Lf/AABEIANsA5gMBIgACEQEDEQH/xAAcAAACAgMBAQAAAAAAAAAAAAAEBQMGAAIIBwH/xABMEAACAQIEBAMDCAUKBAQ
                                
                                ' size='medium' circular />
                            </Grid.Column>
                            <Grid.Column width={13}>
                                <p>MOTHERBOARD</p>
                                <Input id='motherboard' icon='barcode' placeholder='SERIAL NUMBER' />
                            </Grid.Column>
                        </Grid.Row>

                        <Grid.Row>
                            <Grid.Column width={1}>
                                <Image src='data:image/jpeg;base64,' size='medium' circular />
                            </Grid.Column>
                            <Grid.Column width={13}>
                                <p>CPU_ID</p>
                                <Input id='cpu_id' icon='barcode' placeholder='SERIAL NUMBER' />
                            </Grid.Column>
                        </Grid.Row>

                        <Grid.Row>
                            <Grid.Column width={1}>
                                <Image src='data:image/jpeg;base64,' size='medium' circular />
                            </Grid.Column>
                            <Grid.Column width={13}>
                                <p>MEMORY_ID</p>
                                <Input id='memory_id' icon='barcode' placeholder='SERIAL NUMBER' />
                            </Grid.Column>
                        </Grid.Row>

                        <Grid.Row>
                            <Grid.Column width={1}>
                                <Image src='data:image/jpeg;base64,' size='medium' circular />
                            </Grid.Column>
                            <Grid.Column width={13}>
                                <p>HARD-DISK NUMBER</p>
                                <Input id='hdd_id' icon='barcode' placeholder='SERIAL NUMBER' />
                            </Grid.Column>
                        </Grid.Row>

                        <Grid.Row>
                            <Grid.Column width={1}>
                                <Image src='data:image/jpeg;base64,' size='medium' circular />
                            </Grid.Column>
                            <Grid.Column width={13}>
                                <p>SSD_ID</p>
                                <Input id='ssd_id' icon='barcode' placeholder='SERIAL NUMBER' />
                            </Grid.Column>
                        </Grid.Row>

                        <Grid.Row>
                            <Grid.Column width={1}>
                                <Image src='data:image/jpeg;base64,' size='medium' circular />
                            </Grid.Column>
                            <Grid.Column width={13}>
                                <p>GRAPHICS_ID</p>
                                <Input id='graphics_id' icon='barcode' placeholder='SERIAL NUMBER' />
                            </Grid.Column>
                        </Grid.Row>

                        <Grid.Row>
                            <Grid.Column width={1}>
                                <Image src='data:image/jpeg;base64,' size='medium' circular />
                            </Grid.Column>
                            <Grid.Column width={13}>
                                <p>BATTERY_ID</p>
                                <Input id='battery_id' icon='barcode' placeholder='SERIAL NUMBER' />
                            </Grid.Column>
                        </Grid.Row>
                        <Grid.Row>
                            <Grid.Column width={1}>
                                <Image src='data:image/jpeg;base64,' size='medium' circular />
                            </Grid.Column>
                            <Grid.Column width={13}>
                                <p>SERVICE_ID</p>
                                <Input id='serviceid' icon='barcode' placeholder='SERIAL NUMBER' />
                            </Grid.Column>
                        </Grid.Row>
                    </Grid>
                    </Container>
                </div>
                <div className="button">

                    <Button primary onClick={this.handleSubmit} >Submit</Button>

                </div>
            </div>
        );
    }
}

export default Manufacturer;
